#include <string.h>

void strlen_test(void);

int main (void)
{
	strlen_test();
	return (0);
}

void strlen_test(void)
{
	if (ft_strlen("1234sdfsdf") != strlen("1234sdfsdf"))
		printf("error at strlen #1");
	if (ft_strlen("asdf\0asdf") != strlen("asdf\0asdf"))
		printf("error at strlen #2");
	if (ft_strlen("") != strlen(""))
		printf("error at strlen #3");
}